        generateUUID: function () {
            var e = (new Date).getTime();
            return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (s) {
                var r = (e + 16 * Math.random()) % 16 | 0;
                return e = Math.floor(e / 16), ('x' == s ? r : 3 & r | 8).toString(16);
            })
        },
        resolvePromise: function (data) {
            var decodedData = this.base64Decode(data);
            var transferData = JSON.parse(decodedData);
            var e = transferData['e'];
            var s = transferData['s'];
            var r = transferData['r'];
            r ? this.promises[e].reject(s) : this.promises[e].resolve(s), delete this.promises[e];
        },
        base64Decode: function (base64Str) {
            try {
                if (typeof TextEncoder !== 'undefined') {
                    var d = new TextDecoder('utf-8');
                    return d.decode(Uint8Array.from(window.atob(base64Str), function (c) {
                        return c.codePointAt(0);
                    }));
                } else {
                    return decodeURIComponent(escape(window.atob(base64Str)));
                }
            } catch (e) {
                return window.atob(base64Str);
            }
        }
    };

