<body>
    <script>
        window.onGiosgInteractionEvent = (event) => {
            return new Promise((resolve, reject) => {
                var o = {
                    command: 'giosgInteractionEvent',
                    event: event
                };
                try {
                    window.webkit.messageHandlers.aiqua.postMessage(o);
                    resolve("Action done", event);
                } catch (e) {
                    reject(e);
                }
            });
        };

        var Android = {};
        Android.setVisibleElementsBoundingBox = function(event) {
            console.log("setVisibleElementsBoundingBox", JSON.stringify(event));
            return new Promise((resolve, reject) => {
                var o = {
                    command: 'onElementLayoutChanged',
                    event: event
                };
                try {
                    window.webkit.messageHandlers.aiqua.postMessage(o);
                    resolve("Action done", event);
                } catch (e) {
                    reject(e);
                }
            });
        };

        if (!window.qg) {
            var self = function() {}

            self.promises = {};

            self.newPromise = function() {
                const promiseId = performance.now().toString();
                console.log('promise id:', promiseId);
                const promise = new Promise((resolve, reject) => {
                    self.promises[promiseId] = {resolve: resolve, reject: reject};
                });
                return {promiseId: promiseId, promise: promise};
            }

            self.takePromise = function(promiseId) {
                const promise = self.promises[promiseId];
                delete self.promises[promiseId];
                return promise;
            }

            self.resolve = function(promiseId, result) {
                console.log('resolve:', promiseId, result)
                var promise = self.takePromise(promiseId);
                if (promise) {
                    promise.resolve(result);
                }
            }

            self.reject = function(promiseId, error) {
                console.log('reject:', promiseId, error)
                var promise = self.takePromise(promiseId);
                if (promise) {
                    promise.reject(error);
                }
            }

            self.base64Decode = function(base64Str) {
                try {
                    if (typeof TextEncoder !== 'undefined') {
                        var decoder = new TextDecoder('utf-8');
                        return decoder.decode(
                            Uint8Array.from(
                                window.atob(base64Str),
                                function(c) {
                                    return c.codePointAt(0);
                                }
                            )
                        );
                    } else {
                        return decodeURIComponent(escape(window.atob(base64Str)));
                    }
                } catch (e) {
                    return window.atob(base64Str);
                }
            }

            window.appier = function() {
                if (!arguments || arguments.length == 0) {
                    console.log('qg is called but invalid');
                    return;
                }

                var method = arguments[0];
                console.log('qg is called:', method, arguments.length);
                if (method == 'getRecommendationByScenario') {
                    if (arguments.length >= 3) {
                        var options = arguments[1];
                        var callback = arguments[2];
                        var {promiseId, promise} = self.newPromise()
                        promise.then(result => {
                            var recItems = JSON.parse(self.base64Decode(result[0]));
                            var recId = result[1];
                            var scenarioId = result[2];
                            var modelId = result[3];

                            var items = recItems.map(item => {
                                if (item.url.indexOf('?') !== -1) {
                                    item.url += '&';
                                } else {
                                    item.url += '?';
                                }
                                item.url += '"

"=' + encodeURI(item.productId);
                                return item;
                            });
                            callback(null, items);
                        }).catch(error => {
                            callback(error, null);
                        })

                        var message = {
                            command: 'getRecommendationByScenario',
                            promiseId: promiseId,
                            options: options
                        };
                        window.webkit.messageHandlers.aiqua.postMessage(message);
                    }
                }
            }

            window.qg = window.appier;
        }
    </script>
